import { Route, Routes, Navigate } from "react-router-dom";
import AllQuotes from "./pages/AllQuotes";
import QuoteDetails from "./pages/QuoteDetails";
import NewQuote from "./pages/NewQuote";
import Layout from "./components/layout/Layout";
import NotFound from "./pages/NotFound";
import Comments from "./components/comments/Comments";

function App() {
  return (
    <div>
      <Layout>
        <Routes>
          <Route
            path="/"
            element={<Navigate replace to="/quotes"></Navigate>}
          />

          <Route path="/quotes/*" element={<AllQuotes></AllQuotes>} />

          <Route
            path="/quotes/:quoteId"
            element={<QuoteDetails></QuoteDetails>}
          >
            <Route
              path=""
              element={
                <div className="centered">
                  <Link className="btn--flat" to={`${match.url}/comment`}>
                    Load Comments
                  </Link>
                </div>
              }
            />
            <Route path='comment' element={<Comments></Comments>}>

            </Route>
          </Route>

          <Route path="/new-quote" element={<NewQuote></NewQuote>} />

          <Route path="*" element={<NotFound></NotFound>} />
        </Routes>
      </Layout>
    </div>
  );
}

export default App;
